script: |
  super -f text -I q9625.spq | sort > q9625.out

inputs:
  - name: q9625.spq
    data: |
      SELECT col2 - - col0 * + col1 + + col2 AS col0 FROM tab0 (FORMAT parquet) WHERE - + col0 / - col2 * - - CAST ( NULL AS INTEGER ) >= col2;
  - name: tab0

outputs:
  - name: q9625.out
    data: |
